import { MailOutline, Phone, Send } from '@material-ui/icons'
import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  height: 60vh;
  background-color: #fcf5f5;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Title = styled.h1`
  font-size: 70px;
  margin-bottom: 20px;
`;

const Description = styled.div`
  font-size: 24px;
  font-weight: 300;
  margin-bottom: 20px;
`;
const ContactItem = styled.div`
  margin-bottom: 20px;
  display: flex;
  align-content: center;
  letter-spacing: 2px;

`;

const Left = styled.div`
  flex: 1;
  padding: 20px;
  margin: 300px;
`;

const Right = styled.div`
  flex: 1;
  padding: 20px;
`;

const InputContainer = styled.div`
  width: 30%;
  height: 40px;
  background-color: white;
  display: flex;
  justify-content: space-between;
  border:1px solid lightgray;

`;

const Input = styled.input`
  border: none;
  flex : 8;
  padding-left : 20px; /*space between content and range*/
`;

const Button = styled.button`
  flex : 1;
  border: none;
  background-color: #A35127;
  color: white;
  cursor: pointer;
`;

const Contact = () => {
  return (
    <Container>
      <Left>
      <Title>Contact Us</Title>
      <ContactItem>
          <Phone style={{marginRight:"10px"}}/>+65 9108 9652
        </ContactItem>
        <ContactItem>
          <MailOutline style={{marginRight:"10px"}}/>ahmahomemade0414@gmail.com
        </ContactItem>
      </Left>
      <Right>
        <Title>Newsletter</Title>
        <Description>Get timely updates from your favorite products!</Description>
        <InputContainer>
          <Input placeholder='Your email' />
          <Button>
            <Send/>
          </Button>
        </InputContainer>
      </Right>
    </Container>
  )
}

export default Contact
